    [],nt"revision_timestamp": "2015-01-28T18:07:38.497113",nt"name": "protected-areas-mdp-local-protected-lands",nt"isopen":
    false,nt"url": null,nt"notes": "This data illustrates parcels subject to
    some type of preservation easement as well as properties owned by federal, state,
    and local governments. In addition, properties owned by local land trusts and private
    conservation organizations such as The Nature Conservancy are included. Conversation
    easements include easements from the Maryland Agricultural Land Preservation Foundation
    (MALPF), Rural Legacy, Forest Legacy, Maryland Environmental Trust (MET), county
    and state purchases of development rights, transfers of development rights, open
    space from home owners associations, local open space requirements, and private
    conservation easements. This data is complied from settlement data directly from
    conservation program administrators, county GIS updates on preservation activities,
    and public available data from the Maryland Department of Natural Resources. In
    addition, this data is in the process of being realigned to the 2012 IMAP parcel
    polygons. The realignments at available on a county by county basis depending on
    the production schedule.",nt"license_title": null,nt"extras": [{ntt"key":
